                    "order": "12",
                    "pieces": [
                        {
                            "value": "{\"blocks\":[{\"key\":\"1vtlp\",\"text\":\"La imagen muestra los verbos m\u00e1s presentes dentro del corpus de acuerdo a su tama\u00f1o dentro de la imagen, es decir, que a mayor tama\u00f1o se muestre el verbo, mayor ser\u00e1 su frecuencia dentro del corpus analizado. Se pueden observar las grandes frecuencias de los verbos decir, tener, hacer, saber, llevar, dar, etc. los cuales permiten establecer una relaci\u00f3n directa con la informaci\u00f3n sustra\u00edda de la imagen de \u201cverbs.png\u201d.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}",
                            "type": "texto"
                        }
                    ],
