                    "order": "36",
                    "pieces": [
                        {
                            "value": "{\"blocks\":[{\"key\":\"fnq23\",\"text\":\"La imagen muestra las coocurrencias entre chunks y adjetivos dentro del corpus. Esta gr\u00e1fica presenta una coocurrencia fuerte entre el adjetivo de \u201carmado\u201d con los chunks \u201cconflicto armado\u201d, \u201cgrupo armado\u201d y \u201cactor armado\u201d. Esta coocurrencia es de 7.2 con el chunk ``conflicto armado'', 7.1 con el chunk ``grupo armado'' y de 6.5 con el chunk ``actor armado''. Adem\u00e1s, se puede apreciar tambi\u00e9n una fuerte coocurrencia entre el adjetivo \u201cp\u00fablico\u201d y el chunk \u201cfuerza p\u00fablico\u201d con un valor de 6.09.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}",
                            "type": "texto"
                        }
                    ],
