                                        "firstLevel": {
                                            "description": "El registro contiene gr\u00e1ficas de barras, gr\u00e1ficas de bigotes, nubes de puntos, redes y clusters que son producto del an\u00e1lisis del lenguaje realizado por el Equipo de Anal\u00edtica de la Comisi\u00f3n para el Esclarecimiento de la Verdad, la Convivencia y la No Repetici\u00f3n \u2013 CEV al lenguaje afectivo usado en diferentes entrevistas realizadas por la Comisi\u00f3n para el Esclarecimiento de la Verdad, la Convivencia y la No Repetici\u00f3n \u2013 CEV, con el fin de encontrar patrones y tendencias del lenguaje utilizadas por aquellos que narran sus experiencias de vida en torno al conflicto armado colombiano, y c\u00f3mo este uso del lenguaje se relaciona espec\u00edficamente con los diferentes hechos victimizantes dentro del marco de la guerra interna colombiana. Para este prop\u00f3sito, a trav\u00e9s de t\u00e9cnicas de procesamiento del lenguaje, se identificaron las categor\u00edas emocionales m\u00e1s frecuentes a la hora de narrar hechos victimizantes, as\u00ed como niveles de intensidad dentro de los relatos agrupados por hecho; utilizando una construcci\u00f3n de lexicones relacionados con el lenguaje afectivo.",
                                            "title": "El lenguaje del conflicto: productos del an\u00e1lisis del discurso emocional de las v\u00edctimas y sus actores"
                                        },
