                    "order": "72",
                    "pieces": [
                        {
                            "value": "{\"blocks\":[{\"key\":\"2ku3n\",\"text\":\"La imagen muestra los verbos con mayor frecuencia dentro del corpus relativo a ejecuciones extrajudiciales. En este podemos notar que los verbos m\u00e1s frecuentes son \u201cdecir\u201d, \u201cmatar\u201d, \u201ctener\u201d, \u201chacer\u201d, \u201csaber\u201d, \u201cir\u201d, \u201cvenir\u201d y \u201cver\u201d. As\u00ed mismo, es importante resaltar que la escala de la gr\u00e1fica presenta valores bastante altos por lo que incluso aquellos verbos que parecen tener frecuencias bajas podr\u00edan tener frecuencias superiores a 100, como es el caso de \u201caparecer\u201d que cuenta con una frecuencia de 655, \u201cencontrar\u201d con una frecuencia de 1365, \u201cbuscar\u201d con 788, \u201cmorir\u201d con 1035, \u201cmandar\u201d con 982, \u201ccoger\u201d con 1507 o \u201cllevar\u201d con 2977.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}",
                            "type": "texto"
                        }
                    ],
