                {
                    "order": "108",
                    "pieces": [
                        {
                            "value": "{\"blocks\":[{\"key\":\"1gkr1\",\"text\":\"La imagen muestra una gr\u00e1fica del an\u00e1lisis de la categor\u00eda de t\u00e9rminos no estigmatizadores basado en medidas descriptivas de centralizaci\u00f3n de los datos, calculando el promedio del valor de intensidad de los t\u00e9rminos ligados a esa categor\u00eda del lexic\u00f3n en relaci\u00f3n a los a\u00f1os a los que se hace alusi\u00f3n en las entrevistas. En este caso, el a\u00f1o 2004 presenta un valor de intensidad mayor con respecto a los otros a\u00f1os, el cual corresponde a un poco m\u00e1s de 800. Algo similar ocurre en el a\u00f1o 1987, en las gr\u00e1ficas en las que se analizan los otros tipos de estigmatizaci\u00f3n, este fecha cuenta con un valor promedio de intensidad alto con respecto a otros a\u00f1os, elemento que se mantiene en esta categor\u00eda no estigmatizadora con un valor de casi 400. De igual manera, analizar los hechos de los a\u00f1os como el 2005 y el 2016 que act\u00faan de forma similar, puede dar evidencias de c\u00f3mo se daba la estigmatizaci\u00f3n y sus razones en el puerto de Buenaventura.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}",
                            "type": "texto"
                        }
                    ],
                    "id": "108"
                }
