            "title": "El lenguaje del conflicto: an\u00e1lisis desde el discurso emocional de las v\u00edctimas y actores del conflicto \n",
            "description": "Esta colecci\u00f3n se relaciona con la narrativa usada para describir las actividades acontecidas en el conflicto armado, desde el discurso de la vida emocional en las personas dolientes, en este caso v\u00edctimas, actores y participantes del conflicto armado colombiano. En sus secciones se analiza el poder de las palabras  y el uso del lenguaje utilizados en la narraci\u00f3n de los sucesos relacionados con el conflicto y permite ubicarlos dentro de un mapa, que es la representaci\u00f3n gr\u00e1fica de estas narrativas.  ",
